import React from 'react';
import classes from "./Profile.module.css";
import MyPosts from './Myposts/MyPosts';

const Profile = () => {
  return (
    <div>
      <div>
        <img src="https://hornews.com/images/news_large/c1d4b2b8ec608ea72764c5678816d5c9.jpg" alt="ava" className={classes.avatar}></img>
        <span className={classes.username}>Mykytenko Olexander</span>
      </div>
      <MyPosts />
    </div>
  );
}

export default Profile;
